import { BrowserRouter, Routes, Route } from 'react-router-dom';
import './App.scss';
import Header from './components/Header/Header';
import AboutPage from './pages/AboutPage/AboutPage';
import Homepage from './pages/Homepage/Homepage';
import BotePage from './pages/BotePage/BotePage';
import EkonomiPage from './pages/EkonomiPage/EkonomiPage';
import SportPage from './pages/SportPage/SportPage';
import SingleUserPage from './pages/SingleUserPage/SingleUserPage';
import LajmiPage from './pages/LajmiPage/LajmiPage';

function App() {
  return (
    <div className="App">
      <BrowserRouter>
      <Header />
        <Routes>
            <Route path="/" element= {<Homepage />} />
            <Route path="/lajmi" element= {<LajmiPage />} />
            <Route path="/bote" element= {<BotePage/>} />
            <Route path="/ekonomi" element= {<EkonomiPage/>} />
            <Route path="/sport" element= {<SportPage/>} />
            <Route path="user/:id" element= {<SingleUserPage />} />
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
